import { Link } from 'react-router-dom';

class Navbar extends Component {
    state = {  }
    render() { 

        const look = {
            "margin-bottom" : "0px"
        }


        return (
            <div>
                <div class = "jumbotron" style = {look}>
                    <h1>Add Your Task Here</h1>
                </div>
                <nav class = "navbar navbar-expand-md navbar-dark bg-dark">
                    <ul class = "navbar-nav">
                        <li class = "nav-item">
                            <Link to = "/" class = "nav-link"><h4>Tasks List</h4></Link>
                        </li>
                        <li class = "nav-item">
                            <Link to = "/edit" class = "nav-link"><h4>Add Task</h4></Link>
                        </li>
                    </ul>
                </nav>
            </div>
         );
    }
}

export default Navbar;
